import { gameStateAPI } from './api/api';
import './App.css';
import logo from './logo.svg';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" onClick={gameStateAPI.setCurrentQuestion(1)} />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
          onClick={gameStateAPI.getCurrentQuestion()}
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
